import React from 'react';

import './MainPageStyle.css';
import { C_Button, C_Icon, C_IconText} from '../core/Components';
import {Clients} from '../clients/Clients';

export class MainPage extends React.Component {
    constructor(props) {
        super(props);


        this.state = {
            openClients: false,
        }
    }

    openClients(){
        this.setState({openClients: true});
    }

    render(){
        
        return(
            <div id="container">

                <div className="header">
                    <div><C_Icon icon="search"/></div>
                </div>
    
                <div className="body">
                    {this.state.openClients ? 
                        <Clients />                    
                    : undefined}
                </div>
    
              
            </div>
        );
    };
}
